import React, { useState } from "react";
import { useDrag, DndProvider } from "react-dnd";
import { HTML5Backend } from "react-dnd-html5-backend";
import styled from "styled-components";
import { format, addDays, differenceInDays, parseISO } from "date-fns";

// Styled components
const TimelineContainer = styled.div`
  border: 1px solid #ccc;
  padding: 10px;
  overflow-x: auto;
  position: relative;
  height: 300px;
`;

const ZoomControls = styled.div`
  margin-bottom: 10px;
`;

const TaskBar = styled.div`
  position: absolute;
  height: 30px;
  border-radius: 4px;
  color: white;
  padding: 0 5px;
  font-size: 12px;
  display: flex;
  align-items: center;
`;

// Task component
function Task({ task, dates, onDragDrop }) {
  const startIdx = dates.findIndex((d) => d === task.start);
  const endIdx = dates.findIndex((d) => d === task.end);
  const width = (endIdx - startIdx + 1) * 100;

  const [{ isDragging }, drag] = useDrag(() => ({
    type: "TASK",
    item: { id: task.id },
    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  }));

  return (
    <TaskBar
      ref={drag}
      style={{
        left: startIdx * 100,
        width: width,
        backgroundColor: task.color,
        opacity: isDragging ? 0.5 : 1,
        top: task.id * 40,
      }}
    >
      {task.milestone && "ðŸŽ¯"} {task.title} ({task.progress}%)
    </TaskBar>
  );
}

// Main Timeline component
function TimelineCombined() {
  const initialTasks = [
    {
      id: 1,
      title: "Design UI",
      start: "2025-09-22",
      end: "2025-09-25",
      progress: 50,
      color: "#0052CC",
      assignee: "John",
      dependencies: [2],
      milestone: false
    },
    {
      id: 2,
      title: "Develop Backend",
      start: "2025-09-23",
      end: "2025-09-28",
      progress: 20,
      color: "#FF5630",
      assignee: "Alice",
      dependencies: [],
      milestone: true
    },
  ];

  const [tasks, setTasks] = useState(initialTasks);
  const [zoom, setZoom] = useState("week");

  const handleDragDrop = (id, newStart, newEnd) => {
    setTasks((prev) =>
      prev.map((task) =>
        task.id === id ? { ...task, start: newStart, end: newEnd } : task
      )
    );
  };

  const startDate = parseISO("2025-09-20");
  const endDate = parseISO("2025-10-05");
  const totalDays = differenceInDays(endDate, startDate) + 1;

  const dates = [];
  for (let i = 0; i < totalDays; i++) {
    dates.push(format(addDays(startDate, i), "yyyy-MM-dd"));
  }

  return (
    <DndProvider backend={HTML5Backend}>
      <div style={{ padding: "20px", fontFamily: "Arial" }}>
        <h1>Project Timeline</h1>
        <ZoomControls>
          Zoom:
          <select value={zoom} onChange={(e) => setZoom(e.target.value)}>
            <option value="day">Day</option>
            <option value="week">Week</option>
            <option value="month">Month</option>
            <option value="quarter">Quarter</option>
          </select>
        </ZoomControls>
        <TimelineContainer>
          <div style={{ display: "flex", borderBottom: "1px solid #ccc" }}>
            {dates.map((date) => (
              <div
                key={date}
                style={{
                  minWidth: "100px",
                  borderRight: "1px solid #eee",
                  textAlign: "center",
                }}
              >
                {date}
              </div>
            ))}
          </div>
          {tasks.map((task) => (
            <Task
              key={task.id}
              task={task}
              dates={dates}
              onDragDrop={handleDragDrop}
            />
          ))}
        </TimelineContainer>
      </div>
    </DndProvider>
  );
}

export default TimelineCombined;
